import React from 'react';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';

const popup = props => {(
  <Popup trigger={props.pop} position="right center">
    <div>Popup content here !!</div>
  </Popup>
)}; 

export default popup
